import React from 'react'

const Search = ({ search, setSearch }) => {

  const handleChange = (e) => setSearch(e.target.value)


  return (
    <div>
      <input
      className="input"
      autoComplete="off"
      type="text"
      id="search"
      placeholder="Search bar"
      onChange={handleChange}
      />
    </div>
  )
}

export default Search
